import React from 'react'
import './AddressCard.css'
import 'semantic-ui-css/semantic.min.css'
import { Button, Icon, Label } from 'semantic-ui-react'

const AddressCard = () => {
    return (
        <div className="container-fluid login-block">
            <div className="row">
                <div className=" col-sm-6 col-md-6">
                    <h2 className="text-center " class="login-sec">Join us for Your Business</h2>
                    <form style={{ fontSize: '18px', fontFamily: 'Cambo', padding: '12px 12px' }}>
                        <div class="form-group">
                            <label for="tId">Title</label>
                            <input style={{ fontSize: '18px' }} type="text" class="form-control" id="tId" placeholder="Enter Title" />
                        </div>
                        <div class="row form-group">
                            <div class="col">
                                <label for="nId">Name</label>
                                <input style={{ fontSize: '18px' }} type="text" class="form-control" id="nId" placeholder="Enter name" />
                            </div>
                            <div class="col">
                                <label for="eId">Email</label>
                                <input style={{ fontSize: '18px' }} type="email" class="form-control" id="eId" placeholder="Enter Email" />
                            </div>
                        </div>
                        <div class="form-group">
                            <label for="areaId">Content</label>
                            <textarea style={{ fontSize: '18px' }} placeholder="Enter Content" class="form-control" id="areaId" rows="3"></textarea>
                        </div>
                        <div class="form-group">
                            <Button as='div' labelPosition='right' style={{
                                padding: '15px', fontFamily: 'Cambo',
                                fontSize: '18px', marginRight: '30px'
                            }}>

                                <Label as='a' basic pointing='right'>
                                    Send
                             </Label>
                                <Button icon>
                                    <Icon name='mail' />
                                </Button>
                            </Button>
                            <Button as='div' labelPosition='right' style={{ fontFamily: 'Cambo', fontSize: '18px' }}>                                <Label as='a' basic pointing='right'>
                                Cancel
                             </Label>
                                <Button icon>
                                    <Icon name='cancel' />
                                </Button>
                            </Button>
                        </div>
                    </form>
                </div>
                <div className=" col-sm-6 col-md-6 login-sec pt-5" style={{ alignItems: 'center' }}>
                    <img className="img-fluid" src="https://static.pexels.com/photos/33972/pexels-photo.jpg" alt="First slide" />
                </div>
            </div>
            <div class="row" style={{ justifyContent: 'center', fontFamily: 'Cambo', fontSize: 18 }}>
                <div className="copy-text">Kumo Solution <i className="fa fa-heart" style={{ color: 'rgb(50, 108, 235)' }}></i> Group</div>

            </div>
        </div>


    )
}
export default AddressCard
